// src/components/UploadForm.jsx
import React, { useState, useEffect } from "react";
import Clipboard from "clipboard";

function UploadForm() {
  const [clientName, setClientName] = useState("");
  const [files, setFiles] = useState({
    cpf: null,
    cnh: null,
    rg: null,
    energyBill: null,
    phoneEmail: null,
    additionalDocs: [],
  });
  const [sharedLink, setSharedLink] = useState("");
  const [copySuccess, setCopySuccess] = useState("");

  useEffect(() => {
    const clipboard = new Clipboard(".copy-button", {
      text: () => sharedLink,
    });

    clipboard.on("success", () => {
      setCopySuccess("Link copiado com sucesso!");
    });

    clipboard.on("error", () => {
      setCopySuccess("Falha ao copiar o link.");
    });

    return () => clipboard.destroy();
  }, [sharedLink]);

  const handleFileChange = (e, field) => {
    const file = e.target.files[0];
    setFiles((prevFiles) => ({
      ...prevFiles,
      [field]: file,
    }));
  };

  const handleAdditionalDocsChange = (e) => {
    const filesArray = Array.from(e.target.files);
    setFiles((prevFiles) => ({
      ...prevFiles,
      additionalDocs: filesArray,
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const formData = new FormData();
    formData.append("clientName", clientName);

    Object.entries(files).forEach(([key, file]) => {
      if (file) {
        if (Array.isArray(file)) {
          file.forEach((f, index) => {
            formData.append(
              "files",
              new File(
                [f],
                `${clientName}_${key}_${index + 1}.${f.name.split(".").pop()}`
              )
            );
          });
        } else {
          formData.append(
            "files",
            new File([file], `${clientName}_${key}.${file.name.split(".").pop()}`)
          );
        }
      }
    });

    try {
      const response = await fetch("http://localhost:3000/api/upload", {
        method: "POST",
        body: formData,
      });

      if (!response.ok) {
        throw new Error("Erro no envio do formulário");
      }

      const data = await response.json();
      setSharedLink(data.sharedLink);
    } catch (error) {
      console.error("Erro ao enviar arquivos:", error);
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <input
        type="text"
        placeholder="Nome do Cliente"
        value={clientName}
        onChange={(e) => setClientName(e.target.value)}
      />
      <div>
        <label>
          CPF:
          <input type="file" onChange={(e) => handleFileChange(e, "cpf")} />
        </label>
      </div>
      <div>
        <label>
          CNH:
          <input type="file" onChange={(e) => handleFileChange(e, "cnh")} />
        </label>
      </div>
      <div>
        <label>
          RG:
          <input type="file" onChange={(e) => handleFileChange(e, "rg")} />
        </label>
      </div>
      <div>
        <label>
          Conta de Energia:
          <input type="file" onChange={(e) => handleFileChange(e, "energyBill")} />
        </label>
      </div>
      <div>
        <label>
          Celular e E-mail:
          <input type="file" onChange={(e) => handleFileChange(e, "phoneEmail")} />
        </label>
      </div>
      <div>
        <label>
          Documentos Adicionais:
          <input
            type="file"
            multiple
            onChange={handleAdditionalDocsChange}
          />
        </label>
      </div>
      <button type="submit">Enviar</button>
      {sharedLink && (
        <div>
          <p>Link de Compartilhamento: <a href={sharedLink} target="_blank" rel="noopener noreferrer">{sharedLink}</a></p>
          <button className="copy-button">Copiar Link</button>
          {copySuccess && <span>{copySuccess}</span>}
        </div>
      )}
    </form>
  );
}

export default UploadForm;
